import React from "react";
import HeadCon from "../containers/newheader";
import { useParams } from 'react-router-dom';

export default function Story(children,...rest) {
    const {storyid} = useParams();
    return (
        <>
                <HeadCon/>
                <div>this is ${storyid}</div>
        </>
    )
}
